// export default ProfilePage;
//
import React, { useState, useEffect } from 'react';
import '../styles/pages/ProfileStyle.css';
import Navbar from '../components/Navbar';

function ProfilePage() {
    const [isEditing, setIsEditing] = useState(false);
    const [userData, setUserData] = useState({
        email: '',
        username: '',
        isVerified: '',
    });

    useEffect(() => {
        async function fetchUserData() {
            try {
                // Make a GET request to your API endpoint to fetch user data
                const response = await fetch('http://localhost:3000/api/auth/profile/:userId', {
                    method: 'GET',
                    headers: {
                        // Add any headers if needed
                    },
                });

                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }

                const data = await response.json();
                setUserData(data); // Update userData state with the fetched data
                console.log('Fetched user data:', data); // Print user data in the console
            } catch (error) {
                console.error('Error fetching user data:', error);
            }
        }

        // Call the async function inside useEffect and await the promise
        fetchUserData();
    }, []); // Empty dependency array to fetch data only once when the component mounts

    const handleSaveClick = () => {
        setIsEditing(false);
        // Add logic to save updated data here
    };

    const handleEditClick = () => {
        setIsEditing(true);
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setUserData({
            ...userData,
            [name]: value,
        });
    };

    return (
        <div className="profile-container">
            <Navbar />
            <div className="profile-card">
                <div className="profile-header">
                    <img
                        src={process.env.PUBLIC_URL + '/profile.png'}
                        alt="ProfilePage"
                        className="profile-image"
                    />
                    <h2 className="profile-title">ProfilePage Information</h2>
                </div>
                <div className={`status-rectangle ${userData.isVerified === 'Yes' ? 'verified' : 'not-verified'}`}>
                    {userData.isVerified === 'Yes' ? 'Verified' : 'Not Verified'}
                </div>
                <div className="profile-info">
                    <div className="profile-item">
                        <label className="profile-label">Email:</label>
                        <input
                            type="text"
                            name="email"
                            value={userData.email}
                            onChange={handleInputChange}
                            className="profile-input"
                            disabled={!isEditing} // Disable input when not in edit mode
                        />
                    </div>
                    <div className="profile-item">
                        <label className="profile-label">Username:</label>
                        <input
                            type="text"
                            name="username"
                            value={userData.username}
                            onChange={handleInputChange}
                            className="profile-input"
                            disabled={!isEditing} // Disable input when not in edit mode
                        />
                    </div>
                    <button
                        className={isEditing ? "profile-save-button" : "profile-edit-button"}
                        onClick={isEditing ? handleSaveClick : handleEditClick}
                    >
                        {isEditing ? "Save" : "Edit"}
                    </button>
                </div>
            </div>
        </div>
    );
}

export default ProfilePage;
